  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112253 includes chemical,
  discrete sample, physical and profile data collected from MIRAI in the North Pacific
  Ocean and South Pacific Ocean from 1999-10-13 to 1999-11-20 and retrieved during
  cruise MR99-K06 and PACIFICA_49NZ19991013. These data include DISSOLVED INORGANIC
  CARBON, HYDROSTATIC PRESSURE, Potential temperature (theta), SALINITY and WATER
  TEMPERATURE. The instruments used to collect these data include CTD, Coulometer
  for DIC measurement and bottle. These data were collected by Kentaro Ando of Japan
  Agency for Marine-Earth Science and Technology (Jamstec) and Masao Ishii of Meteorological
  Research Institute; Geochemical Research Department as part of the PACIFICA_49NZ19991013
  data set.nnPACIFICA (PACIFic ocean Interior CArbon) was an international collaborative
  project for the data synthesis of ocean interior carbon and its related parameters
  in the Pacific Ocean. The North Pacific Marine Science Organization (PICES), Section
  of Carbon and Climate (S-CC) supported the project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
